import React from 'react';
import './App.css';
import CreatePackage from './CreatePackage';
import ViewPackages from './ViewPackages'; // Importă componenta ViewPackages
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Courier Management System</h1>
        <nav>
          <ul>
            <li>
              <Link to="/">Create Package</Link>
            </li>
            <li>
              <Link to="/view-packages">View My Packages</Link>
            </li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" element={<CreatePackage />} />
          <Route path="/view-packages" element={<ViewMyPackages />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
